UPDATE `quest_template` SET `OfferRewardText`='<Tooranu looks over the documents you discovered.>$B$BIt''s all here, $N. Details of how the cult is tearing up the Highlands, who they''ve sent, where they are, and what they plan to do. Invaluable.$B$BI shall distribute this knowledge to the rest of the Earthen Ring at once. Thank you, friend.' WHERE `entry`=28853; -- Kill the Courier
UPDATE `quest_template` SET `OfferRewardText`='<You open the documents and look for any noteworthy information.>' WHERE `entry`=28815; -- Twilight Documents
UPDATE `quest_template` SET `OfferRewardText`='A high priestess, you say?  And a member of the Twilight Council?$B$BExcellent work.  I hope you find your rewards suitable.' WHERE `entry`=28814; -- Followers and Leaders
UPDATE `quest_template` SET `OfferRewardText`='Blessings upon you.  Please accept this as a token of my gratitude.' WHERE `entry`=28760; -- Vengeance for Orsis
UPDATE `quest_template` SET `OfferRewardText`='Every soldier we deny to the Scourge is more than one life saved.$B$BThank you.' WHERE `entry`=29864; -- Working at the Source
UPDATE `quest_template` SET `OfferRewardText`='Excellent! It is only a matter of time before the son of Deathwing feels my claws.' WHERE `entry`=27445; -- General Drakkisath, Hand of Nefarian
UPDATE `quest_template` SET `OfferRewardText`='Hail, $N.  There is much we need to talk about.$B$BI hope your mind is an open one.  The decisions I make are not understood by many.  Only my closest collaborators have understanding of the portents I see and the signs I await.$B$BWhen I joined forces with Illidan it was based on visions foretelling that otherwise my race would have been destroyed.  I''ve waited patiently for other signs and visions to come to pass... Velen''s exodus... the opening of the Dark Portal... and now... your arrival.' WHERE `entry`=10628; -- Akama
UPDATE `quest_template` SET `OfferRewardText`='Here you are, $c. With this you should find maneuvering in the sea to be nearly effortless. $b$bNow we must get to work. There is much to be done in little time.' WHERE `entry`=24432; -- Sea Legs
UPDATE `quest_template` SET `OfferRewardText`='I hear you, $r.$b$bI understand the urgency, but these men are in no condition to fight.' WHERE `entry`=25405; -- Rest For the Weary
UPDATE `quest_template` SET `OfferRewardText`='I knew I could count on you!$B$BWith their forces in disarray, we can really get this invasion going. ' WHERE `entry`=29528; -- War on the Ramparts
UPDATE `quest_template` SET `OfferRewardText`='I thank you, $N.  Even after I had escaped, I did not imagine I''d be able to return home.' WHERE `entry`=28779; -- A Long Way from Home
UPDATE `quest_template` SET `OfferRewardText`='May your sense of honor and duty serve Azeroth well, $c.' WHERE `entry`=28825; -- A Personal Summons
UPDATE `quest_template` SET `OfferRewardText`='Not exactly the battle you had anticipated, I''ll wager. But a battle nonetheless, as you shall soon see....' WHERE `entry`=14482; -- Call of Duty
UPDATE `quest_template` SET `OfferRewardText`='Now that your eyes have seen the truth, where will you choose to serve?' WHERE `entry`=28826; -- The Eye of the Storm
UPDATE `quest_template` SET `OfferRewardText`='So it is done.$B$BWould that I could bring this entire mountain down upon itself, I would.' WHERE `entry`=28854; -- Closing a Dark Chapter
UPDATE `quest_template` SET `OfferRewardText`='So it''s true. The fel orcs and the Burning Legion are working together in some capacity.' WHERE `entry`=29529; -- Demons in the Citadel
UPDATE `quest_template` SET `OfferRewardText`='Very well, $N.  Your allegiance is no longer in question.  You may see Akama now.' WHERE `entry`=10622; -- Proof of Allegiance
UPDATE `quest_template` SET `OfferRewardText`='We''ve been expecting you, $N.  Akama said you would arrive sooner or later.' WHERE `entry`=10686; -- The Warden's Cage
UPDATE `quest_template` SET `OfferRewardText`='Well done! The long term effects of this attack will be far worse than slaying a few orcs could ever be.' WHERE `entry`=29594; -- Hitting Them Where It Hurts
UPDATE `quest_template` SET `OfferRewardText`='While you were away, I was able to revive some of the fallen soldiers.$b$bWe''ll need every hand if we are to survive here.' WHERE `entry`=25281; -- Pay It Forward
UPDATE `quest_template` SET `OfferRewardText`='Yes!  The four fragments of the medallion.  Now to put them together...' WHERE `entry`=10685; -- The Ashtongue Corruptors
UPDATE `quest_template` SET `OfferRewardText`='You saw Nefarian when you fought Rend?$B$B<Acride sighs.>$B$BI wish I had accompanied you, then. I could have faced him unaware, outside his lair...but no matter. Nefarian will die by my claw.$B$BYou''ve done well.' WHERE `entry`=27444; -- The False Warchief
UPDATE `quest_template` SET `RequestItemsText`='Did you find any demons in there?' WHERE `entry`=29529; -- Demons in the Citadel
UPDATE `quest_template` SET `RequestItemsText`='How many piles were you able to take?' WHERE `entry`=29594; -- Hitting Them Where It Hurts
UPDATE `quest_template` SET `RequestItemsText`='How''d yeh fare in thar, matey?' WHERE `entry`=13131; -- Junk in My Trunk
UPDATE `quest_template` SET `RequestItemsText`='It is good to see that you''re still alive, $r.$b$bHave you found the items I require?' WHERE `entry`=24432; -- Sea Legs
UPDATE `quest_template` SET `RequestItemsText`='These appear to be the right documents.' WHERE `entry`=28815; -- Twilight Documents
UPDATE `quest_template` SET `RequestItemsText`='Were you successful? We have a lot riding on this operation, $N.' WHERE `entry`=29528; -- War on the Ramparts
UPDATE `quest_template` SET `RequestItemsText`='What have you discovered, $c?' WHERE `entry`=28853; -- Kill the Courier
UPDATE `quest_template` SET `RequestItemsText`='You''d best not suggest I ride with you on... whatever that thing is you flew in on.' WHERE `entry`=28779; -- A Long Way from Home
